    script.src = "https://apis.google.com/js/platform.js";
    document.head.appendChild(script);
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
   <React.StrictMode>
    {/* <GoogleOAuthProvider clientId=".apps.googleusercontent.com"> */}

